import initialState from './initialState';
import { FETCH_PARTIES, RECEIVE_PARTIES } from '../actions/actionTypes';

const partiesInitialState = {
  parties: []
}

export default function parties(state = initialState.parties, action) {
  let newState;

  switch (action.type) {
    case FETCH_PARTIES:
      return action;

    case RECEIVE_PARTIES:
      newState = action.stuff;
      return newState;

    default:
      return state;
  }
}
